import React from 'react'
import { View, Text, Platform, SafeAreaView, StyleSheet, TouchableOpacity } from 'react-native'
import { RegularText, LightText, ExtraBoldText, MediumText } from '../components/Shared/StyledText'
import Ionicons from 'react-native-vector-icons/Ionicons'


export default function ProfileScreen() {
    return (
        <SafeAreaView style={styles.androidSafeArea}>
            <View style={styles.top}>
                <MediumText style={{
                    fontSize: 20,
                    fontWeight: '700'
                }}>Profile</MediumText>
            </View>
            <View style={styles.middle}>
                <View style={styles.inMiddle}>
                    <View style={styles.imageBoundary}></View>

                    <View style={{ justifyContent: 'center', }}>
                        <RegularText
                            style={{
                                fontSize: 18,
                                fontWeight: '600',
                                marginBottom: 10
                            }}> Nyarko Betrand</RegularText>
                        <MediumText
                            style={{
                                color: 'gray',
                                fontWeight: '800'
                            }}> +233264774091</MediumText>
                    </View>
                </View>

                <View style={{ flexDirection: 'row', alignItems: 'center' }}>
                    <Ionicons name="mail-outline" size={20} style={{
                        color: 'gray',
                        fontWeight: 'bold',
                        marginRight: 2,

                    }} />
                    <MediumText
                        style={{
                            color: 'gray',
                            fontWeight: '800',
                            fontSize: 15
                        }}>Betrand2354@gmail.com</MediumText>
                </View>
            </View>
            <View style={styles.bottom}>
                <TouchableOpacity style={{ height: 20, width: '100%', backgroundColor: 'white' }}></TouchableOpacity>
            </View>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    androidSafeArea: {
        flex: 1,
        paddingTop: Platform.OS === "android" ? StatusBar.currentHeight : 0,
        marginHorizontal: 10

    },
    top: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center'

    },
    middle: {
        flex: 1.8
    },
    inMiddle: {
        flexDirection: 'row',
        marginBottom: 10
    },
    imageBoundary: {
        height: 90,
        width: 90,
        borderRadius: 10,
        backgroundColor: 'blue',
        marginRight: 10
    },
    bottom: {

        flex: 6
    }
})
